import React, { useState } from 'react';
import './css/s_log.css';

function FacultyLogin() {
    const [showNotification, setShowNotification] = useState(false);
    const [passwordVisible, setPasswordVisible] = useState(false);
    const [username, setUsername] = useState('');
    const [password, setPassword] = useState('');
    const [unameError, setUnameError] = useState('');
    const [passError, setPassError] = useState('');

    const togglePassword = () => {
        setPasswordVisible(!passwordVisible);
    };

    const validateFacultyForm = () => {
        let isValid = true;
        setUnameError('');
        setPassError('');

        if (username.trim() === '') {
            setUnameError('Username is required.');
            isValid = false;
        }

        if (password.trim() === '') {
            setPassError('Password is required.');
            isValid = false;
        } else if (password.length < 6) {
            setPassError('Password must be at least 6 characters.');
            isValid = false;
        }

        if (!isValid) return false;

        const correctUsername = 'faculty123'; // Example username
        const correctPassword = 'password123'; // Example password

        if (username !== correctUsername || password !== correctPassword) {
            setShowNotification(true);
            setTimeout(() => {
                setShowNotification(false);
            }, 3000);
            return false;
        }

        localStorage.setItem('isLoggedIn', 'true');
        window.location.href = 'fac_main.html'; // Redirect to faculty main page
        return true;
    };

    const handleSubmit = (e) => {
        e.preventDefault();
        validateFacultyForm();
    };

    return (
        <div id="std_log">
            {showNotification && (
                <div className="notification">
                    <i>⚠️</i>
                    <span>Invalid username and password combination</span>
                    <span className="close-btn" onClick={() => setShowNotification(false)}>✖</span>
                </div>
            )}

            <nav className="navbar navbar-expand-lg navbar-light fixed-top py-3" id="mainNav">
                <div className="container px-4 px-lg-5">
                    <img src="assets/logo.png" alt="logo" width="200px" height="50px" className="logo" />
                    <div className="btn-container">
                        <a className="btn" href="/std_log">
                            <img src="assets/student.png" alt="student" width="45px" height="45px" />
                            Student Log-in
                        </a>
                    </div>
                </div>
            </nav>

            <div className="c2">
                <div id="heading">
                    <h1>Faculty</h1>
                </div>
                <div className="get_ip">
                    <h2>Log-in</h2>
                    <div className="form" align="center">
                        <form id="FacultyForm" onSubmit={handleSubmit}>
                            <span className="error">{unameError}</span>
                            <input
                                type="text"
                                id="uname"
                                placeholder="Username"
                                name="uname"
                                value={username}
                                onChange={(e) => setUsername(e.target.value)}
                            /><br />

                            <span className="error">{passError}</span>
                            <div className="password-container">
                                <input
                                    type={passwordVisible ? 'text' : 'password'}
                                    id="pass"
                                    placeholder="Password"
                                    name="pass"
                                    value={password}
                                    onChange={(e) => setPassword(e.target.value)}
                                />
                                <span className="toggle-password" onClick={togglePassword}>
                                    <img
                                        src={passwordVisible ? 'assets/eye2.png' : 'assets/eye1.png'}
                                        alt="Show/Hide Password"
                                        id="eye"
                                    />
                                </span>
                            </div>
                            <a href="forgot_pass.html" className="nyr">Forgot Password?</a>
                            <br /><br />

                            <input type="submit" value="Submit" />
                        </form>
                    </div>
                </div>
            </div>
        </div>
    );
}

export default FacultyLogin;
